import React from 'react';
import styled from 'styled-components';

function Login() {
  return (
    <Container>
    <Logo>
        <img src="logo.png" alt="" />
    </Logo>
    </Container>
  )
}
const Container = styled.div`
    width : 100%;
    min-width:450px;
    height: fit-content;
    padding:15px;
    margin:auto;
    display:flex;
    flex-direction:column;
    aligh-item:center;
    border:10x solid red;
`;

const Logo = styled.div`
    width:120px;
    img{
        width:100%;
    }
`;

export default Login
